import React, {Component} from 'react';
import {Tab, Tabs, TabList, TabPanel} from 'react-tabs';
import './ourvalues.scss';
import Heading from "../../common/heading/heading";

import Modal from 'react-responsive-modal';
import ContactForm from "../../common/contact-form/contact-form";

class ApartmentsPlansSection extends Component {
    state = {
        open: false,
        isLoading: true,
    }
    data = []

    constructor(props){
        super(props);
        this.load()
    }

    onCloseModal = () => {
        this.setState({open: false});
    };

    load = () => {
        fetch('/api/our-values.json')
            .then((response) => response.json())
            .then((res) => {
                this.data = res;
                this.setState({isLoading: false})
            })
    }

    render() {
        return (
            <>
            <div className="container">
                <Heading>Mapa</Heading>
            </div>
            <iframe src="https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d14951.356742496395!2d-103.5289097!3d20.4717972!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8425ff76f52115b1%3A0xc272c7f00f17d321!2sParque%20Industrial%20Circuito%20Sur!5e0!3m2!1sen!2smx!4v1663189964793!5m2!1sen!2smx" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>
            </>
        )
    }
}

export default ApartmentsPlansSection
